import React from 'react'
import FeatureList from './FeatureList'

const allFeature = [
    {
        key: "1",
        label: "Head Movement",
        children: [
            {
                key: "1-a",
                label: "Left",
            },
            {
                key: "1-b",
                label: "Right",
            },
            {
                key: "1-c",
                label: "Up",
            },
            {
                key: "1-d",
                label: "Down",
            }
        ]
    },
    {
        key: "2",
        label: "Facial Expression",
        children: [
            {
                key: "2-a",
                label: "Happy",
            },
            {

            }
        ]
    }
]


const Feature = () => {
  return (
    <>
        <div className="row">
            <div className="col text-center">
                <h2>Features</h2>
                <p className="mt-3">
                    <div className="row mt-3 d-flex justify-content-center">
                        <div className="col-lg-8 text-left text-dark">
                            <FeatureList data={allFeature} />  
                        </div>
                    </div>    
                </p>
            </div>
        </div>
    </>
  )
}

export default Feature
